import React from "react";
import HomeIcon from '@mui/icons-material/Home';
import FavoriteIcon from '@mui/icons-material/Favorite';

export const Sidebardata = [
    {
        title:"Home",
        icon:<HomeIcon></HomeIcon>,
        link:"/dashboard"
    }
    ,
    {
        title:"Liked Songs",
        icon:<FavoriteIcon></FavoriteIcon>,
        link:"/dashboard"
    }
    ,
    {
        title:"Add Songs",
        icon:<HomeIcon></HomeIcon>,
        link:"/dashboard"
    }
    ,
    {
        title:"Remove Songs",
        icon:<HomeIcon></HomeIcon>,
        link:"/login"
    }

]
